import { Component, OnDestroy, OnInit } from '@angular/core';
import { LoginService } from 'src/app/services/auth/login/login.service';
import { SignService } from 'src/app/services/auth/sign/sign.service';

@Component({
  selector: 'app-navbar',
  templateUrl: './navbar.component.html',
  styleUrls: ['./navbar.component.css']
})
export class NavbarComponent implements OnInit, OnDestroy {
  userLoginOn:boolean=false;

  constructor(private serviciodeLogin:LoginService, private serviciodeSign: SignService) { }
  ngOnDestroy(): void {
    this.serviciodeLogin.currentUserLoginOn.unsubscribe();
  }

  ngOnInit(): void {
    this.serviciodeLogin.currentUserLoginOn.subscribe(
      {
        next:(userLoginOn) => {
          this.userLoginOn=userLoginOn;
        }
      }
    )

    //this.serviciodeSign.
  }

}
<!--<nav class="navbar navbar-expand-sm navbar-dark bg-dark"> -->
  <nav class="navbar navbar-expand-sm navbar-dark bg-dark ">

    <a class="navbar-brand" href="/nohome"> <img src="assets/img/logo.png" width="30" height="30" alt="" loading="lazy"> FiestApp </a>

  <!--BOTON VISTA MOVIL-->
  <button class="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarSupportedContent" aria-controls="navbarSupportedContent" aria-expanded="false" aria-label="Toggle navigation">
      <span class="navbar-toggler-icon"></span>
  </button>

  <!--BOTONS DEL NAVBAR-->
  <!--<div class="collapse navbar-collapse" id="navbarSupportedContent"></div>-->
  <div class="collapse navbar-collapse"  id="navbarSupportedContent"  style="vertical-align:middle;">
    <ul class="navbar-nav ">
      <li class="nav-item" routerLinkActive="active">
        <a class="nav-link" routerLink="home" >Inicio</a>
      </li>
      <li class="nav-item" routerLinkActive="active">
        <a class="nav-link" routerLink="search">Buscar</a>
      </li>    

      <li class="nav-item dropdown">
        <a class="nav-link dropdown-toggle" href="#" id="navbarDropdownMenuLink" data-toggle="dropdown" aria-haspopup="true" aria-expanded="false">
          Tops
        </a>
        <div class="dropdown-menu" aria-labelledby="navbarDropdownMenuLink">
          <a class="dropdown-item" href="TopArtistas">Top Artistas</a>
          <a class="dropdown-item" href="#">Top Albums</a>
          <a class="dropdown-item" href="#">Top Playlists</a>
        </div>
      </li>  

      <li *ngIf="!userLoginOn" class="nav-item" routerLinkActive="active">
        <a class="nav-link" routerLink="/login">Iniciar Sesión</a>
      </li>

      <li *ngIf="userLoginOn" class="nav-item" routerLinkActive="active">
        <a class="nav-link" routerLink="/nohome">Cerrar Sesion</a>
      </li>  

      <li *ngIf="!userLoginOn" class="nav-item" routerLinkActive="active">
        <a class="nav-link" routerLink="/signup"> Registrarse</a>
      </li>

    </ul>

  </div>
  </nav>
